                    <span > Home
                    </span></button>
            </Link>
            <Link to='/Favorites'>
                <button id="bt3About" onClick={() => { SubmitSound.play() }}>
                {
                 allCharacters.length>0 ? (
                 <span>â¤ï¸</span>
                  ) : (
                <span >ð¤</span>
                 )
                }
                    <span >{allCharacters.length}</span>
                </button>
            </Link>

        </>
    }

    return <div className="nav">
        {location.pathname === "/home" ? (HomeNav()) : null}
